import OplaceWrapper from './components/OplaceWrapper';
import './styles.css'; 

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Ordr</h1>
        <p>Descripción de tu aplicación</p>
      </header>
      <OplaceWrapper />
    </div>
  );
}

export default App;
